INSERT INTO `dt14330_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
  (10002, 10037, 'Mary Smith', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-05-29 13:35:45', '2018-05-29 13:35:45', 'Zeyn filled out the webform and clicked \"I want to know more about Jesus\".', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10003, 10036, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 13:38:02', '2018-05-29 13:38:02', 'This is my neighbor from Morocco, living in Madrid currently. I am adding him to Disciple.Tools because I gave him a Bible last week and He has been reading it. We read Matthew 5-7 together, and he was excited to read more on his own.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10004, 10038, 'Mary Smith', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-05-29 13:39:12', '2018-05-29 13:39:12', 'This contact selected \"I want to become a Christian, but there are obstacles\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10005, 10039, 'Mary Smith', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-05-29 13:41:04', '2018-05-29 13:41:04', 'This contact selected \"I feel in my heart that I\'m ready to become a Christian\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10006, 10040, 'Mary Smith', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-05-29 13:42:37', '2018-05-29 13:42:37', 'This contact selected \"I want to know more about Jesus and the Bible\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10007, 10041, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 13:44:13', '2018-05-29 13:44:13', 'He private messaged us on FB. He came with the usual questions/arguments, \"God can\'t have a son,\" \"what is the trinity?\" \"the Bible has been corrupted.\" However, he has been responding with great follow up questions to the articles I sent him on these topics. He is very open to expanding his knowledge base. He is asking to get a Bible of his own and wants to meet a Christian in person. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10008, 10042, 'Mary Smith', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-05-29 13:44:45', '2018-05-29 13:44:45', 'This contact selected \"I want to know more about Jesus and the Bible\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10009, 10043, 'Mary Smith', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-05-29 13:46:49', '2018-05-29 13:46:49', 'This contact selected \"No, I\'m not interested right now\" on the webform.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10010, 10045, 'Mary Smith', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-05-29 13:52:55', '2018-05-29 13:52:55', 'Saira has been following our page for a while, though she has not made any comments, only likes. She finally messaged me today and asked me to send her a Bible.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10011, 10046, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 13:55:47', '2018-05-29 13:55:47', 'Yamina contacted our Facebook page after having a dream about Jesus. In the dream, the person she believe was Jesus told her to read \"Ya, Yamina, read my Words. Don\'t be afraid.\" Then after he disappeared, there was a table before her filled with loaves and loaves of bread, and she heard His voice say, \"Eat and you will live.\" She has been going to the university in Madrid and has had some positive interactions with people who go to church. She isn\'t sure what the difference is between Catholicism and Protestantism but she is anxious to meet with someone who can give her Jesus\' Words in her language. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10012, 10047, 'Mary Smith', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-05-29 13:55:51', '2018-05-29 13:55:51', 'Tarik has commented several times on our page, asking questions. He seems to desire to know more, though does not know much about the Bible yet. He sent a private message asking to talk with someone to learn more.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10013, 10048, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 14:03:24', '2018-05-29 14:03:24', 'Ahmen has been very active on the Facebook page, defending against negative posts. He messaged us asking if he could meet with someone to learn how to become a Christian. He likes that the page is in Arabic and he can still meet with someone while living abroad.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10014, 10049, 'Mary Smith', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:07:45', '2018-05-29 14:07:45', 'This contact lives in Gibraltar, but used to live in Madrid. She speaks Spanish fluently. She has been messaging back and forth with me for a few weeks, and seems very interested in talking. She seems very intelligent, and desired to learn more, but is reluctant to bring shame to her elderly parents. She is working on her masters in psychology.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10015, 10050, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 14:11:00', '2018-05-29 14:11:00', 'His parents moved to Spain seeking asylum 20 years ago. He recently found our page and states that he is a Christian. His parents are MBB background which is why they had to leave their country in Syria. He states that he would like to get involved helping other refugees and Arab speakers learn about Jesus. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10016, 10051, 'Mary Smith', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:11:11', '2018-05-29 14:11:11', 'He\'s atheist and a philosophy student and wants to read the Bible.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10017, 10052, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 14:12:56', '2018-05-29 14:12:56', 'He wants to meet with someone face to face. He is asking a lot of good questions and seems like a ready contact for face to face', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10018, 10053, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 14:14:46', '2018-05-29 14:14:46', 'She wants to read the Bible with someone face to face.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10019, 10054, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 14:17:05', '2018-05-29 14:17:05', 'Met a Christian in his country and after working in Spain, wanting to meet more Christians. Seems like he has read quite a bit of the Bible before. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10020, 10055, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 14:19:36', '2018-05-29 14:19:36', 'Ready to meet with someone face to face', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10021, 10056, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 14:20:28', '2018-05-29 14:20:28', 'Ready to meet with someone face-to-face', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10022, 10037, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:39:10', '2018-05-29 14:39:10', '@[Christopher Berganza (multiplier)](11) This guy filled out our webform, wanting to know more about Jesus, and gave his phone number. Would you be able to call him and see where he\'s at and if he would like to meet up?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10023, 10038, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:42:53', '2018-05-29 14:42:53', '@[Christopher Berganza (multiplier)](11)  new guy in Castilla. Can you try to meet with him when you travel there next?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10024, 10039, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:44:24', '2018-05-29 14:44:24', '@[Christopher Berganza (multiplier)](11) This guy is down in Morocco, but has said he wants to become a Christian. Can you call him and see if he would be willing to meet you halfway?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10025, 10040, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:45:17', '2018-05-29 14:45:17', '@[Christopher Berganza (multiplier)](11) Found a guy actually near you! Please call him and find out where he\'s at.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10026, 10042, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:47:41', '2018-05-29 14:47:41', '@[Isabel Arboleda (multiplier)](9) This lady would like to find out more. Can you call her and try to meet?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10027, 10043, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:51:18', '2018-05-29 14:51:18', '@[Christopher Berganza (multiplier)](11) This contact said he\'s not interested on the webform, but took the time anyway to fill out the form and give us his phone number. It might be worth giving him a call anyway.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10028, 10045, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:52:51', '2018-05-29 14:52:51', '@[Isabel Arboleda (multiplier)](9) Would you be able to meet up with Saira to give a Bible? She lives in Catalonia.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10029, 10041, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '192.168.0.3', '2018-05-29 14:53:15', '2018-05-29 14:53:15', '@[Anthony Palacio (multiplier)](10) See my note on this guy below. Can you give him a call today?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10030, 10047, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:53:57', '2018-05-29 14:53:57', '@[Christopher Berganza (multiplier)](11) This guy is trying to learn more. He said he lives in Aragon, but ask him if he would meet you halfway.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10031, 10055, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '192.168.0.3', '2018-05-29 14:55:04', '2018-05-29 14:55:04', '@[Anthony Palacio (multiplier)](10) This guy has been discussing some deep stuff on FB. I think he should probably go ahead and meet with someone face to face. You can check out the convo on FB if you log-in if you would like some more context. But remember, don\'t bring up what you read about him say because you don\'t want to creep him out.  See if he is willing to meet you soon.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10032, 10049, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:55:06', '2018-05-29 14:55:06', '@[Isabel Arboleda (multiplier)](9) Check out the comment below. Please call Charifa and see if you can meet.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10033, 10051, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 14:56:14', '2018-05-29 14:56:14', '@[Christopher Berganza (multiplier)](11) Would you try and meet up with Youssouf to give him a Bible?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10034, 10048, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '192.168.0.3', '2018-05-29 14:56:15', '2018-05-29 14:56:15', '@[Anthony Palacio (multiplier)](10) When are you heading to Castilla region? I have this guy and a couple others you could try to meet up with on your next round. Let me know and I will assign you all of them.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10035, 10048, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-05-29 15:03:36', '2018-05-29 15:03:36', '@[Rachel Black (dispatcher)](7) I am actually planning on going there next week. Send them all my way and I will contact them today.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10036, 10048, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '192.168.0.3', '2018-05-29 15:04:51', '2018-05-29 15:04:51', '@[Anthony Palacio (multiplier)](10) Perfect! Thanks for the quick reply.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10037, 10054, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '192.168.0.3', '2018-05-29 15:07:18', '2018-05-29 15:07:18', '@[Anthony Palacio (multiplier)](10) Here is guy #2 from Castilla. He is also Tunisian. I wonder if there is a population of them growing out there. See what you can find out, ok? Thanks!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10038, 10056, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '192.168.0.3', '2018-05-29 15:07:50', '2018-05-29 15:07:50', '@[Anthony Palacio (multiplier)](10) Here is guy #3 from Castilla. He hasn\'t mention where he is from originally.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10039, 10045, 'Isabel Arboleda (multiplier)', 'multiplier1@disciple.tools', '', '192.168.0.3', '2018-05-29 15:11:37', '2018-05-29 15:11:37', 'I called Saira and she seems keen to meet up. She says she\'s not sure what to believe anymore and wants to read more to decide for herself. She is 17 and in her final year at school. She is busy this week with exams so I will call her again next week.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1009),
  (10040, 10054, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-05-29 15:14:44', '2018-05-29 15:14:44', 'Phone Call Notes: \n\n- This guy is hungry!\n- Someone gave him a Bible in Tunisia\n- Starting working in Spain 2 years ago\n- Has another friend he has been talking to (invited him to join us)\n- His friend\'s name is Mazifa\n- Available to meet next week (monday-wed for coffee after work)\n- Scheduled for Tuesday at 5:30 pm. Will meet in front of the big statue on the Main St.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10041, 10049, 'Isabel Arboleda (multiplier)', 'multiplier1@disciple.tools', '', '192.168.0.3', '2018-05-29 15:17:00', '2018-05-29 15:17:00', '@[Dami치n Abell치n (Dispatcher)](6) I\'m sorry, I\'m not able to travel as far as Gibraltar - it\'s a bit too far for me, without a car. Please can you assign this to someone else?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1009),
  (10042, 10048, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-05-29 15:18:40', '2018-05-29 15:18:40', 'Phone Call notes:\n\n- He called while I was on the phone with Amesfal. \n- Called back and he answered this time\n- He was super excited about my call. He has been actually reading a ton of our articles on our website. \n- Asked him if he had any friends that he could bring with him and he said he didn\'t know of any interested like him\n- Encouraged him to think of others open minded like him and feel free to have them join us\n- Scheduled to meet for Tuesday lunch at 12:30 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10043, 10049, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 15:20:32', '2018-05-29 15:20:32', '@[Jane Doe (multiplier)](4) Would you be able to travel to Gibraltar, or get Charifa to meet you halfway?', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10044, 10041, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-05-29 15:22:46', '2018-05-29 15:22:46', '@[David Smith](8) Hey bud, I gave this guy a call but it was the wrong number. Can you message him again on FB and double check with him on the number? Thanks!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10045, 10045, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-05-29 15:25:18', '2018-05-29 15:25:18', '@[Isabel Arboleda (multiplier)](9) Since she is 17, it might be a good idea to ask if her parents are fine with her bringing a Bible home. You can always show her how to get it on her phone (in fact, it\'s good to do this anyway), if she can\'t have one at home. We try to be careful with minors.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10046, 10050, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-05-29 15:27:52', '2018-05-29 15:27:52', 'Phone Call Notes:\n\n- This guy is passionate! Man, I like this guy.\n- He told me a similar story as David mentioned, told him to tell me more when we meet\n- He really wants to meet. He said he is available tomorrow morning.\n- Meeting at 9 am at the main roundabout with the big flag', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10047, 10056, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-05-29 15:33:17', '2018-05-29 15:33:17', 'Phone Call Notes:\n\n- This guy feels sketchy to me. Maybe he is scared because he is dodging my questions a bit. \n- I told him my friend David gave me his number but he was still unsure and didn\'t really want to meet\n\n@[David Smith](8)  Can you make sure this guy is actually ready or reassure him?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10048, 10048, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '192.168.0.3', '2018-05-29 15:35:07', '2018-05-29 15:35:07', '@[Anthony Palacio (multiplier)](10) This sounds great! I will let our prayer champion know about your meeting.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10049, 10041, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 15:46:18', '2018-05-29 15:46:18', '@[Anthony Palacio (multiplier)](10) Ah, man, I am sorry. I submitted the wrong number. I just changed it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10050, 10056, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-05-29 15:48:11', '2018-05-29 15:48:11', '@[Anthony Palacio (multiplier)](10) I talked to him again, I realized I never told him my name. We talked a bit and her understands now that you are my friend and will be traveling to his area next week. Give him another call.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10051, 10056, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-05-29 15:58:07', '2018-05-29 15:58:07', 'Meeting Notes:\n\n- Was much more relaxed and willing to meet.\n- Scheduled for next Tuesday in the morning at 7 am.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1010),
  (10052, 10049, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-05-29 16:12:41', '2018-05-29 16:12:41', '@[Dami치n Abell치n (Dispatcher)](6) Yeah I was going to make a special south trip next week, feel free to send me anyone living in the sound between now and next week. Maybe assign eastern folks to Isabel?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10053, 10049, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-05-29 16:14:31', '2018-05-29 16:14:31', 'Phone Call Notes:\n\n- She is very eager to meet\n- She wants to bring her roommate which is great!\n- We will meet next week on Tuesday after her classes finish around 4 pm. I will call her next week to confirm a time.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10054, 10053, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-05-29 16:18:40', '2018-05-29 16:18:40', '@[David Smith](8) Can you add her FB name. I would like to read the conversation between you guys a bit more.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10055, 10038, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-05-30 14:09:09', '2018-05-30 14:09:09', 'Ismail seems eager to meet and is willing to come into Madrid to meet. We will try to meet this Saturday.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10056, 10039, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-05-30 14:10:42', '2018-05-30 14:10:42', 'No answer today. Will try again tomorrow.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10057, 10040, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-05-30 14:12:01', '2018-05-30 14:12:01', 'We talked on the phone for a while. He has a lot of questions. He did ask if I could give him a Bible. We will try to meet tomorrow evening.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10058, 10043, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-05-30 14:13:19', '2018-05-30 14:13:19', 'He said he was busy and will call me back.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10059, 10047, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-05-30 14:16:00', '2018-05-30 14:16:00', 'I have talked with Tarik on the phone twice already, in 3 days! He has a lot of questions, but also just seems to need a friend. He isn\'t able to travel this week, but has to come to Madrid in a week for business.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10060, 10051, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-05-30 14:18:13', '2018-05-30 14:18:13', 'I will try to call him tonight and see where he lives in Castilla y Leon, if he\'s close to Madrid, I should be able to meet with him this week.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10061, 10050, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 12:02:39', '2018-06-01 12:02:39', 'This guy is the real deal! He shared more details about his story with me. He comes from a seemingly grounded Biblical family. He has been baptized and has a strong relationship with the Lord. He says he is very interested in getting involved in sharing his faith and seemed very teachable.\n\nI would like to help coach him on being able to share his story/testimony in different fragments of time. I would also like that we put together a list of 100 people he knows in his life and start casting vision about sharing His story and God\'s story with those people. \n\nHe wants to meet again this week.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10062, 10048, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 12:14:58', '2018-06-01 12:14:58', 'What a great first meeting! He didn\'t bring anyone with him. I shared the creation to Christ story with him to set up the basis that the Bible is a full story, made complete in Christ. We read Matthew 1-7 together in our meeting. He kept speaking a lot about how different it was than Islam.\n\nI encouraged him to read the entire book of Matthew nothing stories and words Jesus uses about what it means to follow Him. I told him to give me a call when he is finished reading it and ready to meet again.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10063, 10056, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 12:16:35', '2018-06-01 12:16:35', 'I called Mohammed the day before, the day of, during when were supposed to meet and he didn\'t answer.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10064, 10054, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 12:24:46', '2018-06-01 12:24:46', 'Amesfal brought Mazifa. He met him in Spain and began sharing with him what he had been learning about God from the Injil. We started reading Matthew. Amesfal was very talkative so it was sometimes difficult to gauge where Mazifa was in it all. We read Matthew 5 like a DBS (Discovery Bible Study). This helped Mazifa have a chance to talk more. Had to really push the DNA of asking them, \"Where do you see that in the passage?\" By the end, they were automatically doing that. I encouraged them to read the Book of Matthew. I casted vision of other Tunisians like them discovering, sharing, and obeying God\'s Word together. It excited them.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10065, 10060, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 12:27:14', '2018-06-01 12:27:14', 'Friend that Amesfal brought with him to our first meeting', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10066, 10041, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 12:39:01', '2018-06-01 12:39:01', 'Set up a meeting for tomorrow at 7 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10067, 10055, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 12:39:45', '2018-06-01 12:39:45', 'Wow! He is willing to meet today!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10068, 10052, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 12:40:44', '2018-06-01 12:40:44', '@[David Smith](8) Is this the right number? This guy hasn\'t been answering. Could you check with him on FB?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10069, 10052, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-01 12:46:12', '2018-06-01 12:46:12', '@[Anthony Palacio (multiplier)](10) Yeah this is the right number but it seems that he has turned off his Facebook account so I am unable to contact him and ask. Try calling him a few more times and then maybe we put him on pause.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10070, 10061, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-01 13:00:03', '2018-06-01 13:00:03', 'This guy is super argumentative on the page. He has contacted us wanting to know who is behind the page. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10071, 10062, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-01 13:03:08', '2018-06-01 13:03:08', 'This guy is wanting a Book. He doesn\'t want to meet with anyone though. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10072, 10062, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-01 13:04:49', '2018-06-01 13:04:49', '@[Rachel Black (dispatcher)](7) Can you contact the Book mailers to get a Book mailed out to this guy?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10073, 10063, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-01 13:42:21', '2018-06-01 13:42:21', 'This girls says she wants to become a believer.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10074, 10064, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-01 13:45:24', '2018-06-01 13:45:24', 'Says he is a believer and wants to be baptized.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10075, 10065, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-01 14:00:40', '2018-06-01 14:00:40', 'He says that he is a Muslim but wants to know more about the Messiah, the Christian religion, and the Injil. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10076, 10066, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-01 14:08:13', '2018-06-01 14:08:13', 'In FB private message, he clicked on the FB bot\'s option \"I want to receive the Book in person\"', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10077, 10067, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-01 14:12:30', '2018-06-01 14:12:30', 'This actually lady contacted our prayer network\'s FB page. Says she is wanting to meet other Christians who grew up Muslim in Spain. The network facilitator pointed her to our FB page and she she private messaged us for a meeting', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10078, 10068, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-01 14:18:14', '2018-06-01 14:18:14', 'He wants to read the Bible with someone', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10079, 10063, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '192.168.0.3', '2018-06-01 14:30:05', '2018-06-01 14:30:05', '@[Isabel Arboleda (multiplier)](9) Can you contact this girl ?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10080, 10064, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '192.168.0.3', '2018-06-01 14:31:19', '2018-06-01 14:31:19', 'Can you contact this guy and try to meet with him?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10081, 10065, 'Rachel Black (dispatcher)', 'dispatcher2@disciple.tools', '', '192.168.0.3', '2018-06-01 14:31:59', '2018-06-01 14:31:59', '@[Anthony Palacio (multiplier)](10) Are you able to follow up with this guy?', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1007),
  (10082, 10049, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-06-01 14:39:25', '2018-06-01 14:39:25', 'Sharif brought her roommate Aisha. We started reading in Matthew together. They read in Arabic and explained the passage to me. I asked them DBS style questions as we went. Toward the end, they were both very convinced that this was the true way. They said they want to learn how to becomes Christians. I encouraged them to keep reading Matthew and take note of what it means to follow Jesus and we could all meet again and talk about it. They were excited to both receive a Bible. Aisha even kissed her\'s!', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10083, 10067, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-06-01 14:41:53', '2018-06-01 14:41:53', 'Planning to meet this Thursday for coffee at 7 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10084, 10053, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-06-01 14:44:02', '2018-06-01 14:44:02', 'Scheduled a meeting for tomorrow at 1 pm', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10085, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 14:49:38', '2018-06-01 14:49:38', 'Note: He was already baptized\n Met with Nassim. Very interesting guy and I want to continue meeting with him. He came to faith four years ago and has been alone for most of his walk with the Lord. He actually got baptized by someone in Morocco. He hasn\'t had any regular fellowship though since that group stopped meeting. I talk to him about the vision of starting a group of other Moroccans in Extremadura. He got really excited and we read through Acts one and two. I used it to cast a vision that a church could be started anywhere and he really caught on to the idea. Then we walked through Matthew 1-4 and I modeled for him how he could do this without others. I told him to make a list of 100 and he already had some ideas of who he could share with. He was super grateful that I had came out and met with him and very excited that he had someone to talk to. He has two sisters, both are married, one of them is married to a Spanish Christian and the other one is married to another Muslim guy from Morocco. Apparently his parents are very open-minded.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10086, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 14:51:09', '2018-06-01 14:51:09', '@[David Smith](8) Can you ask him for his real number? This one doesn\'t work.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10087, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 14:52:15', '2018-06-01 14:52:15', 'He is in the middle of studying, has read two books of the NT in spanish. Wants to meet up but is busy with studies. Told him to start reading Matthew and we would discuss it when we met.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10088, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 14:56:48', '2018-06-01 14:56:48', 'May 15- met with Nassim again. It was a good meeting. We read through Matthew 5-10. We talked about bringing in a friend and having him walk them through Matthew 1- 10. At the end of our meeting he talked about us needing to get together for a longer period of time so that he could invite someone and we can walk them through Matthew. Hopefully we will do that soon. I actually had him walk me through Matthew five through 10 next and teach it to me and just gave him suggestions on how better to explain. I think it helped gave him confidence that he can do this on his own.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10089, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 14:57:59', '2018-06-01 14:57:59', 'May 20: Not free over the next three days. Says Mon or Fri can maybe meet.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10090, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 14:58:22', '2018-06-01 14:58:22', 'Ok, we will meet Friday.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10091, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 14:59:20', '2018-06-01 14:59:20', 'Nassim cancelled today because his dad is sick but he is done with classes this week and will have a break on Wednesday. Said to come anytime.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10092, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 15:00:32', '2018-06-01 15:00:32', 'Line is now busy.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10093, 10066, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 15:01:12', '2018-06-01 15:01:12', 'called no answer. Line still busy.  Haven\'t been able to get ahold of this guy for months.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10094, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 15:03:03', '2018-06-01 15:03:03', 'After the weekend, he is going to find us a good place to meet and a time that works.\n He has actually read all four gospels and Acts. He is currently reading Romans. He says he can\'t meet until Spring Break because that\'s the first break he gets from class but I told him I could see him', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10095, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 15:04:01', '2018-06-01 15:04:01', 'He could only meet on Saturday and I was already booked solid. Will try next Saturday', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10096, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 15:09:27', '2018-06-01 15:09:27', 'May 17- Met with the new guy Nabil today. We met downtown. He is 15 years old. He is studying and about four years ago saw a documentary on how Arabs invaded North African and tried forcing many of the Berbers to change. He decided he wouldn\'t go back to Islam. He\'s been to the mosque to pray but he just felt like it was wrong. he wanted to see some signs. Started reading the Bible. One day he was sitting in a park and he felt a burning sensation in the palms of his hand, where they crucified Jesus. And then he saw two doves fly by in the direction of downtown. He took it as a sign that he needed to go downtown and when he went downtown he found a bookseller and the bookseller just happen to have a copy of the Bible in Arabic.  Up until then He had mostly been reading it online and from Facebook. He has read Matthew through Romans and is currently in first Corinthian\'s. We read from Matthew 1-6 as well as Matthew 28. He got the vision and he wants to be baptized. He actually considers himself a believer since last November. He was praying and asking God for help and then I called him. His dad is a dentist here and an atheist. He lived in Portugal for a while. His mother is Muslim but she\'s not very strong in the faith. They already know that he\'s a Christian. They don\'t have a problem with it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10097, 10064, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-01 15:11:19', '2018-06-01 15:11:19', 'He continues to study and read through the Bible. He has finished all the Gospels and the Epistles up to 1 Peter. Good questions so far and growing in his understanding. He is also in the middle of exams and can\'t really meet but at least he has continued to study the Word.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10098, 10069, 'Mary Smith (marketer)', 'marketer1@disciple.tools', '', '192.168.0.3', '2018-06-01 15:29:59', '2018-06-01 15:29:59', 'This man became attracted  to Christianity through TV, he has never read a Gospel nor met a believer, but he would like to do both. He lives in Madrid.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1005),
  (10099, 10069, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-06-01 15:40:46', '2018-06-01 15:40:46', '@[Christopher Berganza (multiplier)](11) Here is another from Madrid.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10100, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-06-01 15:43:25', '2018-06-01 15:43:25', 'He has watched brother Rashed on TV but has never read a Bible and doesn\'t have a smartphone. Meeting arranged for Saturday at 12pm in town. Will call Saturday to confirm and decide on location.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10101, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-06-01 15:46:00', '2018-06-01 15:46:00', 'Meeting went well. He wanted to read the Bible. Gave him NT. Shared the Gospel with him and gave him the intro to Matthew. Reading comprehension was pretty good.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10102, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-06-01 15:52:36', '2018-06-01 15:52:36', 'Met with Wasim again today. He is further along. Finished reading Matthew. Understood a lot of the big ideas but is still thinking from an Islamic mindset. Hopefully more time in the word will change that. Will have him read the book of John next and then acts. We looked at several passages today.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10103, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-06-01 15:56:34', '2018-06-01 15:56:34', 'I called a few times to see how he was doing - no answer, then he called back and missed me.\nI called again and he didn\'t have work today so we set a time to meet. Wasim had already finished reading John since last week. I felt led to read through Matthew 5, so he read a section and then we talked about each section all the way through Matthew 5. He expressed two times that he has entered into being a follower now.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10104, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-06-01 15:59:08', '2018-06-01 15:59:08', 'Met with Wisam. It was a great meeting. He has read up to revelation. More exciting is that he has had a dream last night. He saw Jesus appear to him. Jesus told him \"if you love me you will love Allah. I will love you\" I showed him John 14 \"I am the way the truth and the life...\" He said \"that\'s what Jesus was telling me!!!\" I have been reading, now what do I have to do, I want to do more than read I want to follow Jesus. I showed him acts 2. Repent and be baptized. He wanted to get baptized tomorrow already! Praise God.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10105, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-06-01 16:03:09', '2018-06-01 16:03:09', 'Praise God!', 0, 'trash', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10106, 10069, 'Dami치n Abell치n (Dispatcher)', 'dispatcher1@disciple.tools', '', '192.168.0.3', '2018-06-01 16:05:29', '2018-06-01 16:05:29', 'Praise God!', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1006),
  (10107, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-06-01 16:18:03', '2018-06-01 16:18:03', 'Met up with Wisam. We traveled over to the coast to baptize him. On the way out he was talking about how he wanted to be an ambassador for Christ and get the word out to everyone. I asked him to retell how he came to know Christ. He talked about searching. Comparing the Koran and Injil. Then he had a dream. Jesus appeared to him. In a white robe and a bright light. His face was covered in light. He said \"you are my son (child) follow me.\" He said he felt peace and mercy and joy like he never had before. Then he woke up. There was no turning back after that.\n When he was baptized he said he felt like a new man, something powerful happened. We studied acts 1-3 together. He is really catching the vision.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10108, 10069, 'Christopher Berganza (multiplier)', 'multiplier4@disciple.tools', '', '192.168.0.3', '2018-06-01 16:23:23', '2018-06-01 16:23:23', 'It has been a week since Wasim got baptized and he had a second dream last night. Jesus appeared to him and told him to not be afraid. I am sending you to tell others about me, to many other nations.\nPTL! He is re-reading Acts now.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', 'comment', 0, 1011),
  (10109, 10067, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-06-05 15:48:09', '2018-06-05 15:48:09', 'We had a great meeting. Read through Matthew 1-5. I could tell she was getting tired toward the end of 5, so I encouraged her to keep reading on her own and contact me when she is finished reading Matthew. \n\nBefore she started to show signs of being tired, she was very engaged in the Word and had lots of good questions. I told her to write down her questions and wait and see if the Bible answers them for her. Just like a good story, we have to wait and see what happens.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10110, 10046, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-06-05 15:49:38', '2018-06-05 15:49:38', 'Excited to meet. Was studying all week but is done with her finals for this semester. Plan to meet this Thursday night at 7 pm.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10111, 10049, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-06-05 15:53:40', '2018-06-05 15:53:40', 'Met with Sharif and Aisha again. They both read through Matthew and were excited to meet again. They really dug into the Book and had lots of great insights as they explained back what they had learned and discovered. They both expressed that they believe that Jesus is more than a prophet and want to keep reading the Bible and learn more. I asked them to explain to me what they think it means to follow Jesus and be a Christian. We started reading in the Book of John together. They are going to read that Book and call me when they are finished with it.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10112, 10071, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-06-05 15:55:06', '2018-06-05 15:55:06', 'Friend of Charif.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
