  (10115, 10053, 'Jane Doe (multiplier)', 'multiplier2@disciple.tools', '', '192.168.0.3', '2018-06-05 15:59:04', '2018-06-05 15:59:04', 'I tried calling her the morning of and an hour before but she didn\'t answer. I decided to show up this time but she didn\'t show. I will try to call her again and see what happened and try to reschedule.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1004),
  (10116, 10072, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-05 16:07:16', '2018-06-05 16:07:16', 'Wants a Book mailed. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10117, 10073, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-05 16:08:17', '2018-06-05 16:08:17', 'A young, high school girl wants to receive a Book and meet a Christian. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10118, 10074, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-05 16:09:56', '2018-06-05 16:09:56', 'A wife wants to learn how to become a Christian. She said her husband has been watching satellite Christian programs, and they are both wanting to receive a Bible. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10119, 10075, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-05 16:11:02', '2018-06-05 16:11:02', 'Wants to receive a Bible', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10120, 10076, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-05 16:14:25', '2018-06-05 16:14:25', 'Read Matthew online 1-10. Says she wants to receive an actual Book.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10121, 10077, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-05 16:16:26', '2018-06-05 16:16:26', 'A woman living in Morocco contacted our FB page and says she doesn\'t know any Christians but wants to meet one. ', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10122, 10078, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-05 16:17:41', '2018-06-05 16:17:41', 'Been talking on our FB chat for a long time. I think she is ready to meet offline.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10123, 10065, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-06 11:43:06', '2018-06-06 11:43:06', '@[Anthony Palacio (multiplier)](10) Here is his real number', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10124, 10079, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-06 11:44:38', '2018-06-06 11:44:38', 'He wants to receive a Book', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10125, 10080, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-06 11:46:26', '2018-06-06 11:46:26', 'He wants to read the Bible with a Christian and learn more about the Christian religion', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10126, 10081, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-06 11:47:03', '2018-06-06 11:47:03', 'He wants a Book mailed to him only', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10127, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-06 11:53:26', '2018-06-06 11:53:26', 'He is interested in studying. Lives near by and don\'t have a Book. Wants to meet tomorrow.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10128, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-06 11:54:19', '2018-06-06 11:54:19', 'met and gave him a Book. His family was in the car and so we werent able to meet for long. He works downtown though and we hope to meet during the week.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10129, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-06 11:54:43', '2018-06-06 11:54:43', 'He called me back and wants to meet up. Would like to meet saturday.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10130, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-06 12:00:32', '2018-06-06 12:00:32', 'May 19- met with Sabri. He is a really nice guy. Paid for the coffee. Wants to learn more because he is worried about the extremists and what they are teaching his kids in the schools. He is an IT guy. His wife also works. They have 2 kids. Both teenagers. He is very open and so is his wife he wants to study this with his kids. We walked through Matthew 1-3 and he liked it and really thought it was easy to understand. I shared the gospel with him and he received it well. We talked about meeting downtown for lunch.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10131, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-06 12:01:43', '2018-06-06 12:01:43', 'He has been busy with a work conference but hopes to meet for lunch tomorrow or this weekend.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10132, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-06 12:02:17', '2018-06-06 12:02:17', 'He has been busy with work but would like to meet up on  Tuesday or Thursday for lunch.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10133, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-06 12:02:57', '2018-06-06 12:02:57', 'I am back from a trip. He doesn\'t work on Sunday. May meet up Sunday.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10134, 10068, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-06 12:05:07', '2018-06-06 12:05:07', 'His phone is off now. I haven\'t been able to get a hold of him for months now.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10135, 10065, 'Anthony Palacio (multiplier)', 'multiplier3@disciple.tools', '', '192.168.0.3', '2018-06-06 14:06:18', '2018-06-06 14:06:18', 'He is 16 years old. More curious than anything else. His mom actually brought him, kind of awkward. She spent the first 20 min explaining that he was a good boy. She didn\'t want him getting into trouble but didn\'t care if he read the Book. Just didn\'t want him smoking. Her husband left them and that made life difficult. The kid doesn\'t have a lot of friends but meets people online on facebook. She then left and said she would be across the street and we could talk. The boy is more curious. Doesn\'t know much but wants to read.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1010),
  (10136, 10065, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-06 14:30:06', '2018-06-06 14:30:06', '@[Anthony Palacio (multiplier)](10) He wrote to me and asked if we can give him another copy of the Book because he has a group of friends interested in reading it', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008),
  (10137, 10064, 'David Smith', 'marketer2@disciple.tools', '', '192.168.0.3', '2018-06-06 14:31:49', '2018-06-06 14:31:49', '@[Anthony Palacio (multiplier)](10) He asked online about baptism. He said that he wants to be baptised but he is afraid because of sin.', 0, '1', 'Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1 Safari/605.1.15', 'comment', 0, 1008);